import Tilt from "react-tilt";


const Logo = function (){
    return (
        <div>
            <Tilt className="Tilt" options={{ max : 25}} style={{ height: 150, width: 150}} >
                <div className="Tilt-inner">i</div>
            </Tilt>
        </div>
    )
}

export default Logo;
